import React, { createContext, useState, useContext, useEffect } from 'react';

// Create a new context for products
const ProductContext = createContext();

// Create a custom hook to use the ProductContext
export const useProduct = () => {
  return useContext(ProductContext);
};

// ProductProvider component to wrap around parts of your app that need product state
export const ProductProvider = ({ children }) => {
  // Initialize state from localStorage or use default values
  const [products, setProducts] = useState(() => {
    const savedProducts = localStorage.getItem('products');
    return savedProducts ? JSON.parse(savedProducts) : [
      { id: 1, name: "Ring Video Doorbell", price: 99, image: '/images/doorbell/RingVideoDoorbell.jpg', description: 'High-definition video doorbell with two-way audio and motion detection.', category: 'Smart Doorbells', published: true, accessories: [
        { id: 101, name: "Ring Chime", price: 29, image: '/images/doorbell/accessories/Ring Chime.jpeg' },
        { id: 102, name: "Ring Solar Panel", price: 49, image: '/images/doorbell/accessories/Ring Solar Panel.jpeg' },
        { id: 103, name: "Ring Plug Adapter", price: 19, image: '/images/doorbell/accessories/Ring Plug Adapter.jpeg' },
        { id: 104, name: "Anti Doorbell Corner", price: 39, image: '/images/doorbell/accessories/Anti Theft Doorbell Corner.jpeg' }
      ] },
      { id: 2, name: "Nest Hello", price: 229, image: '/images/doorbell/NestHello.jpeg', description: 'Smart video doorbell with high-definition video and integrated Google Assistant.', category: 'Smart Doorbells', published: false, accessories: [
        { id: 201, name: "Nest Chime", price: 29, image: '/images/doorbell/accessories/Nest Chime.jpeg' },
        { id: 202, name: "Nest Solar Panel", price: 49, image: '/images/doorbell/accessories/Nest Solar Panel.jpeg' },
        { id: 203, name: "Nest Plug Adapter", price: 19, image: '/images/doorbell/accessories/Nest Plug Adapter.jpeg' },
        { id: 204, name: "Nest Doorbell Corner", price: 39, image: '/images/doorbell/accessories/Nest Doorbell Corner.jpeg' }
      ] },
      { id: 3, name: "Arlo Video Doorbell", price: 179, image: '/images/doorbell/ArloVideoDoorbell.jpg', description: 'Video doorbell with high-definition video, two-way audio, and night vision.', category: 'Smart Doorbells', published: false, accessories: [
        { id: 301, name: "Arlo Chime", price: 29, image: '/images/doorbell/accessories/Arlo Chime.jpeg' },
        { id: 302, name: "Arlo Solar Panel", price: 49, image: '/images/doorbell/accessories/Arlo Solar Panel.jpeg' },
        { id: 303, name: "Arlo Plug Adapter", price: 19, image: '/images/doorbell/accessories/Arlo Plug Adapter.jpeg' },
        { id: 304, name: "Arlo Doorbell Corner", price: 39, image: '/images/doorbell/accessories/Arlo Doorbell Corner.jpeg' }
      ] },
      { id: 4, name: "Eufy Security Video Doorbell", price: 129, image: '/images/doorbell/EufySecurityDoorbell.jpg', description: 'Video doorbell with 2K resolution and advanced AI technology.', category: 'Smart Doorbells', published: true, accessories: [
        { id: 401, name: "Eufy Security Chime", price: 29, image: '/images/doorbell/accessories/Eufy Security Chime.jpeg' },
        { id: 402, name: "Eufy Security Solar Panel", price: 49, image: '/images/doorbell/accessories/Eufy Security Solar Panel.jpeg' },
        { id: 403, name: "Eufy Security Plug Adapter", price: 19, image: '/images/doorbell/accessories/Eufy Security Plug Adapter.jpeg' },
        { id: 404, name: "Eufy Security Doorbell Corner", price: 39, image: '/images/doorbell/accessories/Eufy Security Doorbell Corner.jpeg' }
      ] },
      { id: 5, name: "Remo+ RemoBell S", price: 99, image: '/images/doorbell/RemoBellS.jpg', description: 'Affordable video doorbell with high-definition video and motion detection.', category: 'Smart Doorbells', published: true, accessories: [
        { id: 501, name: "Remo+ RemoBell Chime", price: 29, image: '/images/doorbell/accessories/RemoBell Chime.jpeg' },
        { id: 502, name: "Remo+ RemoBell Solar Panel", price: 49, image: '/images/doorbell/accessories/RemoBell Solar Panel.jpeg' },
        { id: 503, name: "Remo+ RemoBell Plug Adapter", price: 19, image: '/images/doorbell/accessories/RemoBell Plug Adapter.jpeg' },
        { id: 504, name: "Remo+ RemoBell Doorbell Corner", price: 39, image: '/images/doorbell/accessories/RemoBell Doorbell Corner.jpeg' }
      ] }
    ];
  });

  // Save products to localStorage whenever products change
  useEffect(() => {
    localStorage.setItem('products', JSON.stringify(products));
  }, [products]);

  // Function to add a new product
  const addProduct = (product) => {
    setProducts((prevProducts) => [...prevProducts, product]);
  };

  // Function to update an existing product
  const updateProduct = (updatedProduct) => {
    setProducts((prevProducts) =>
      prevProducts.map((product) => (product.id === updatedProduct.id ? updatedProduct : product))
    );
  };

  // Function to remove a product by ID
  const removeProduct = (productId) => {
    setProducts((prevProducts) => prevProducts.filter((product) => product.id !== productId));
  };

  // Function to publish or unpublish a product
  const togglePublishProduct = (productId, published) => {
    setProducts((prevProducts) =>
      prevProducts.map((product) =>
        product.id === productId ? { ...product, published } : product
      )
    );
  };

  return (
    <ProductContext.Provider
      value={{ products, addProduct, updateProduct, removeProduct, togglePublishProduct }}
    >
      {children}
    </ProductContext.Provider>
  );
};
